import { Link } from 'react-router-dom';

const Navigation = () => (
    <nav>
        <ul>
            <li><Link to="/">Etusivu</Link></li>
            <li><Link to="/Build">Rakennussivu</Link></li>
            <li><Link to="/Contact">Yhteystiedot</Link></li>  {/* Lisää linkki yhteystietosivulle */}
        </ul>
    </nav>
);

export default Navigation;
